import React, { Component } from "react";
import HamburgerMenu from "react-hamburger-menu";

class Popup extends Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (
      <div className="menu">
        import {HamburgerArrow} from 'react-animated-burgers'
      </div>
    );
  }
}

export default Popup;
